import React from "react";
import { NavLink } from "react-router-dom";
const Main = (props)=>{
    return(
        <>
            <section className="header">
            <div className="container">
                <div className="row">
                    <div className="col-lg-6 col-md-12 order-lg-1 order-md-2 heading">
                        <h1> {props.title} <span>Asad Rehman</span></h1>
                        <h2>{props.para}</h2>
                        <NavLink to="/services" className="btn btn-get-start">{props.btn}</NavLink>
                    </div>
                    <div className="col-6 col-md-12 order-lg-2 order-md-1 text-center ">
                    <img src={props.imgsrc} alt="asad-log" className="headingImage" width="100px"/>

                    </div>
                </div>
            </div>
        </section>
        </>
    )

}
export default Main;
